import { DIPOSED_MONAY, WITHDORW_MANY } from "../actios/bank_action"

export const reduser=(state=1000,action)=>{
switch(action.type){
case WITHDORW_MANY:
return state-action.paylod
case DIPOSED_MONAY:
return state+action.paylod
default:
return state
}}
